import React, { useState } from 'react';
import './RegistrationForm.css';

const RegistrationForm = () => {
  const [isPermanentSameAsCorrespondence, setIsPermanentSameAsCorrespondence] = useState(false);

  const handleCheckboxChange = () => {
    setIsPermanentSameAsCorrespondence(!isPermanentSameAsCorrespondence);
  };

  return (
    <div className="registration-form-container">
      <h2>Registration</h2>
      <form className="registration-form">
        {/* Room Related Info Section */}
        <div className="form-section">
          <h3>Room Related Info</h3>
          <label>Room:</label>
          <select name="room">
            <option>Select Room</option>
            {/* Add more options here */}
          </select>
          <label>Fee Per Month:</label>
          <input type="text" placeholder="Enter fee per month" disabled />
          <label>Food Status:</label>
          <input type="text" placeholder="Enter food status" disabled />
          <label>Stay From:</label>
          <input type="date" />
          <label>Duration:</label>
          <select name="duration">
            <option>Select Duration in Month</option>
            {/* Add more options here */}
          </select>
        </div>

        {/* Personal Info Section */}
        <div className="form-section">
          <h3>Personal Info</h3>
          <label>Course:</label>
          <select name="course">
            <option>Select Course</option>
            {/* Add more options here */}
          </select>
          <label>Registration No:</label>
          <input type="text" placeholder="Enter registration no." disabled />
          {/* Add more input fields for first name, middle name, etc. */}
        </div>

        {/* Correspondence Address Section */}
        <div className="form-section">
          <h3>Correspondence Address</h3>
          <label>Address:</label>
          <textarea placeholder="Enter address"></textarea>
          {/* Add more input fields for city, state, phone */}
        </div>

        {/* Permanent Address Section */}
        <div className="form-section">
          <h3>Permanent Address</h3>
          <div className="checkbox-group">
            <input 
              type="checkbox" 
              id="sameAsCorrespondence" 
              checked={isPermanentSameAsCorrespondence}
              onChange={handleCheckboxChange}
            />
            <label htmlFor="sameAsCorrespondence">Permanent address same as Correspondence address</label>
          </div>
          {!isPermanentSameAsCorrespondence && (
            <>
              <label>Address:</label>
              <textarea placeholder="Enter address"></textarea>
              {/* Add more input fields for city, state, phone */}
            </>
          )}
        </div>

        {/* Submit and Reset Buttons */}
        <div className="form-buttons">
          <button type="reset" className="reset-button">Reset</button>
          <button type="submit" className="submit-button">Register</button>
        </div>
      </form>
    </div>
  );
};

export default RegistrationForm;
